// src/components/About.js
import React from 'react';

const About = () => {
  return (
    <div className="max-w-3xl mx-auto p-6 text-center">
      <h1 className="text-3xl font-bold mb-4">About Us</h1>
      <p className="mb-4">
        Welcome to our Coffee Beans website! We are passionate about providing
        you with the finest selection of coffee beans from around the world.
      </p>
      <p className="mb-4">
        Our mission is to connect coffee lovers with high-quality coffee
        products and educate them about the different varieties of coffee.
      </p>
      <p>
        Explore our Coffee List to discover new flavors and aromas!
      </p>
    </div>
  );
};

export default About;
